import React from 'react';
import { PDFViewer, PDFDownloadLink, Document, Page, Text, View, Font } from '@react-pdf/renderer';
import { useState } from 'react';
import { styles } from '../styles/resumeStyles';

// Google Fonts CDN을 통한 나눔고딕 폰트 등록
Font.register({
  family: 'NanumGothic',
  src: 'https://fonts.gstatic.com/ea/nanumgothic/v5/NanumGothic-Regular.ttf',
  fontStyle: 'normal',
  fontWeight: 'normal'
});

const ResumeDocument = ({ formData }) => (
  <Document>
    <Page size="A4" style={styles.page}>
      <View style={styles.header}>
        <Text style={styles.formNumber}>접수번호: _____________</Text>
      </View>
      <Text style={styles.title}>노인일자리 신청서</Text>
      
      <View style={styles.table}>
        <View style={styles.row}>
          <Text style={styles.label}>성명</Text>
          <Text style={styles.value}>{formData.name}</Text>
          <Text style={styles.label}>연락처</Text>
          <Text style={styles.value}>{formData.mobilePhone}</Text>
        </View>

        <View style={styles.row}>
          <Text style={styles.label}>주민등록번호</Text>
          <Text style={styles.value}>{formData.residentNumber1}-{formData.residentNumber2}</Text>
        </View>

        <View style={styles.row}>
          <Text style={styles.label}>주소:</Text>
          <Text style={styles.value}>{formData.address} {formData.detailAddress}</Text>
        </View>

        <View style={styles.row}>
          <Text style={styles.label}>최종학력:</Text>
          <Text style={styles.value}>{formData.education}</Text>
        </View>

        <View style={styles.row}>
          <Text style={styles.label}>세대구성:</Text>
          <Text style={styles.value}>{formData.householdType}</Text>
        </View>

        <View style={styles.row}>
          <Text style={styles.label}>희망직종:</Text>
          <View style={styles.column}>
            <Text style={styles.value}>1순위: {formData.desiredPrograms.first}</Text>
            {formData.desiredPrograms.second && (
              <Text style={styles.value}>2순위: {formData.desiredPrograms.second}</Text>
            )}
            {formData.desiredPrograms.third && (
              <Text style={styles.value}>3순위: {formData.desiredPrograms.third}</Text>
            )}
          </View>
        </View>

        <View style={styles.row}>
          <Text style={styles.label}>신청동기:</Text>
          <Text style={styles.value}>{formData.applicationMotives.join(', ')}</Text>
        </View>
      </View>
    </Page>
  </Document>
);

const ResumeTemplate = ({ formData }) => {
  const [loading, setLoading] = useState(false);

  return (
    <div className="pdf-container">
      <PDFViewer style={{ width: '100%', height: '500px' }}>
        <ResumeDocument formData={formData} />
      </PDFViewer>
      
      <PDFDownloadLink 
        document={<ResumeDocument formData={formData} />}
        fileName={`${formData.name}_노인일자리신청서.pdf`}
        className="hmk-button hmk-download-button"
      >
        {({ blob, url, loading, error }) =>
          loading ? '문서 생성중...' : 'PDF 다운로드'
        }
      </PDFDownloadLink>
    </div>
  );
};

export default ResumeTemplate;
